    J. Morse  Pursuant to your letter dated December 16, 2009, please be advised as
    follows:  The committee has taken a corrective action to request a refund from
    New Jersey Democratic State Committee in the amount of $5000.  In the future the
    committee will better attempt to coordinate with its affiliates to avoid making
    any excessive contributions. In addition, we have amended the report to correctly
    reflect the independent expenditures that were omitted on Schedule E (as MEMO)
    and Schedule D.\n"
